<script><!--
var wlb='',Llb='\n',Znb=' ',XCb=' GMT',Vrb=' on ',Vyb=' width="',Brb='" target="_blank">',Nob='">',xCb='$',ppb='%',ylb='&',xsb="'",brb="'.",Flb='(',Pzb='([/\\\\\\.\\*\\+\\?\\|\\(\\)\\[\\]\\{\\}$^])',WCb='+',eCb=', Row size: ',BCb=', Size: ',Ynb='-',dpb='-ga:entrances',Npb='-ga:pageviews',Ypb='-ga:searchRefinements',Bqb='/',zlb='//www.google.com/jsapi?',Cqb='/comments/default',Rzb='/feeds/features/',Ozb='/feeds/maps/',Wzb='/full',Syb='/media/',Hwb='/positions',Xvb='/positions/NASDAQ:GOOG/transactions',uwb='/positions/NASDAQ:GOOG/transactions/1',nCb='0',tvb='123-456-7890',rlb='127.0.0.1:8080',Mzb='1600 Amphitheatre Parkway\nMountain View, CA 94043',Vlb='2.2',_ob='2009-07-01',apb='2009-07-31',wxb='2038-01-19T03:14:07Z',xxb='5-Excellent',yxb='5752122',Klb=':',Oob='<\/a>',Trb='<\/h2>',vzb='<\/h5><h5>GData API version: 2.2<\/h5>',Wrb='<\/i>',Nzb='<Placemark xmlns="http://www.opengis.net/kml/2.2"><name>Faulkner\'s Birthplace<\/name><description/><Point><coordinates>-89.520753,34.360902,0.0<\/coordinates><\/Point><\/Placemark>',Mob='<a href="',Srb='<h2>',uzb='<h5> See source in ',Urb='<i>By ',Uyb='<img src="',nzb="<img src='logo-small.png' alt='gwt logo' align='absmiddle'><span class='hm-title'>Google GData API Library for GWT Demo<\/span>",Wob='<p><i>Description not provided.<\/i><\/p>\n<p>(Add an implementation of <code>getDescriptionHTML()<\/code> for this demo)<\/p>',Kwb='<p>As well as portfolio and transaction feeds, the Google Finance Portfolio Data API offers an intermediate, read-only feed know as the position feed. This is a summary of all of the contents of a particular portfolio, grouped by ticker symbol. Each entry in this feed, know as a position, is derived from the transactions entered for that symbol. Each position entry has position data that may include current number of shares of a particular stock or mutual fund if specified in the transactions as well as investment gain if requested and if purchase price and date have been specified.<\/p>',Uwb="<p>In this sample, all transactions for a particular ticker (e.g. NYSE:IBM) are retrieved for a portfolio. The user's portfolio feed is queried and searched for a portfolio starting with 'GWT-Finance-Client'. The transaction feed for NASDAQ:GOOG is then queried for this portfolio and basic information is displayed. (This portfolio and transaction were created in the examples above -- if no transactions for a given ticker exist, the transaction feed will not exist and an error will be generated).<\/p>",Gqb="<p>This sample adds a new comment to a blog post. The comment's contents contain the text 'GWT-Blogger-Client'.<\/p>",Zzb="<p>This sample code demonstrates how to create and insert a new map feature. It retrieves a list of the user's maps and inserts a feature with a title that starts with 'GWT-Maps-Client'.<\/p>",hAb="<p>This sample code demonstrates how to delete an existing map of the authenticated user. It retrieves a list of the user's maps, and deletes the first map with a title that starts with 'GWT-Maps-Client'.<\/p>",izb="<p>This sample code demonstrates how to update an existing item of the authenticated user. It retrieves a list of the user's items, and updates the first item with a title that starts with 'GWT-GoogleBase-Client' with a new title and target country.<\/p>",zwb='<p>This sample code requests a specific portfolio entry as specified in the request URL.<\/p>',Zqb="<p>This sample creates a new blog post in the user's most recently updated blog. The post's title will be 'GWT-Blogger-Client: inserted post'.<\/p>",grb='<p>This sample deletes a comment from a blog post.<\/p>',rrb="<p>This sample deletes the first blog post it finds that begins with the prefix 'GWT-Blogger-Client'.<\/p>",uqb='<p>This sample demonstrates how to access 50 of the account names, profile names, profile ids and table ids to which your login has access.<\/p>',Upb='<p>This sample demonstrates how to access the top ten pages ordered by number of pageviews to your website.<\/p>',upb='<p>This sample demonstrates how to calculate the bounce rate for the top 10 sources of traffic to your website.<\/p>',pub='<p>This sample demonstrates how to create a new contact entry.<\/p>',yub='<p>This sample demonstrates how to create a new contact group.<\/p>',_vb="<p>This sample demonstrates how to create a transaction.A new transaction is created in a user's Google Finance portfolio by posting a transaction entry to the appropriate Post URL. In this example, a transaction entry object is created and its properties (transaction type, etc.) are set, then the portfolio feed is queried for a list of the user's portfolios. The entry is inserted into the portfolio whose title starts with 'GWT-Finance-Client'.<\/p>",tsb='<p>This sample demonstrates how to create and insert a new calendar. The owncalendars feed is used to insert the new calendar entry for the authenticated user.<\/p>',Mxb='<p>This sample demonstrates how to create and insert a new item. The items feed post URL (http://www.google.com/base/feeds/items) is used to insert a new item entry for the authenticated user.<\/p>',Dzb='<p>This sample demonstrates how to create and insert a new map. The map feed post URL (http://maps.google.com/maps/feeds/maps/default/full) is used to insert a new map entry for the authenticated user.<\/p>',Pvb='<p>This sample demonstrates how to create and insert a new portfolio. The portfolio feed post URL (http://finance.google.com/finance/feeds/default/portfolios) is used to insert a new portfolio entry for the authenticated user.<\/p>',Vsb="<p>This sample demonstrates how to create and insert a recurring event into the authenticated user's primary calendar. The private/full feed is used for event insertion. The specifics of the recurrence such as recurring frequency and recurring duration are specified with a recurring string which is based on the iCalendar specification<\/p>",atb="<p>This sample demonstrates how to create and insert a single event into the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",Dsb="<p>This sample demonstrates how to create and insert a single event with a reminder to the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",Nsb="<p>This sample demonstrates how to create and insert a single event with an extended property in the form of a name-value pair to the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",Hub='<p>This sample demonstrates how to delete a contact entry. It queries for the most recently modified contact entry and deletes it.<\/p>',Sub="<p>This sample demonstrates how to delete a contact group entry. It obtains the contact group that has a title that starts with 'GWT-Contacts-Client' and deletes the group.<\/p>",htb="<p>This sample demonstrates how to delete an existing calendar of the authenticated user. It retrieves a list of the user's own calendars, and delete the first calendar with title that starts with 'GWT-Calendar-Client'. The owncalendars feed is used for calendar deletion.<\/p>",stb="<p>This sample demonstrates how to delete an existing event. A full text query is used to locate those events with the specified text, and the first match will be deleted from the authenticated user's primary calendar. The private/full feed is used for event deletion.<\/p>",Vxb="<p>This sample demonstrates how to delete an existing item of the authenticated user. It retrieves a list of the user's items, and deletes the first item with a title that starts with 'GWT-GoogleBase-Client'.<\/p>",oAb="<p>This sample demonstrates how to delete an existing map feature of the authenticated user. It retrieves a list of the user's maps and deletes the first map feature with a title that starts with 'GWT-Maps-Client'.<\/p>",jwb="<p>This sample demonstrates how to delete an existing portfolio for the authenticated user. It retrieves a list of the user's portfolios, and deletes the first portfolio with a title that starts with 'GWT-Finance-Client'.<\/p>",qwb="<p>This sample demonstrates how to delete an existing transaction within a portfolio of the authenticated user. It deletes the first GOOG transaction in the 'GWT-Finance-Client' portfolio, which was created in a preceeding example (an error will be generated if this does not exist).<\/p>",lqb='<p>This sample demonstrates how to get 30 days worth of Pageviews and Visits from Google Analytics.<\/p>',Jpb='<p>This sample demonstrates how to get the top browser languages in the United States.<\/p><div><strong>Note:<\/strong>if you have no visitors to your site from the United States, you will see no data.<\/div>',fqb="<p>This sample demonstrates how to get the top internal site searches, their keyword refinements and the page the person was taken to when they clicked on the result.<\/p><div><strong>Note:<\/strong> To use this example you'll need to have Google Analytics configured to track internal site searches.<\/div>",nxb='<p>This sample demonstrates how to load individual GData packages. In your GData apps you can enhance performance by loading only the GData packages that are used.<\/p>',ztb='<p>This sample demonstrates how to perform a date query to retrieve events. The date query serves as a filter against all event entries of the private/full feed and return those events that have a start time between the specified minimum and maximum times. <\/p>',Dtb='<p>This sample demonstrates how to perform a full text query to retrieve events. The full text query serves as a filter against all event entries of the private/full feed and return those events that contain the specified text in the event title and/or description.<\/p>',avb='<p>This sample demonstrates how to retrieve all members of a particular group. It first obtains the ID for a given contact group and uses it as the query parameter to retrieve all members of that group.<\/p>',Otb="<p>This sample demonstrates how to retrieve all primary calendar events for the authenticated user. The private/full feed is used to obtain the events from the private calendar with full projection. The sample iterates through the list of events and prints out each event's title.<\/p>",jvb='<p>This sample demonstrates how to retrieve contact entries for the authenticated user.<\/p>',nvb='<p>This sample demonstrates how to retrieve contact entries using query parameters.<\/p>',vvb="<p>This sample demonstrates how to update a contact entry. It obtains the first contact entry with a title starting with 'GWT-Contacts-Client' and updates its title.<\/p>",Dvb="<p>This sample demonstrates how to update a contact group entry. It obtains the first contact group entry that has a title that starts with 'GWT-Contacts-Client' and updates its title.<\/p>",Wtb="<p>This sample demonstrates how to update an existing calendar of the authenticated user. It retrieves a list of the user's own calendars, and updates the first calendar with a title that starts with 'GWT-Calendar-Client'. The owncalendars feed is used to update an existing calendar.<\/p>",PAb="<p>This sample demonstrates how to update an existing map feature of the authenticated user. It retrieves a list of the user's maps and updates the first map feature with a title that starts with 'GWT-Maps-Client' with a new title.<\/p>",HAb="<p>This sample demonstrates how to update an existing map of the authenticated user. It retrieves a list of the user's maps, and updates the first map with a title that starts with 'GWT-Maps-Client' with a new title.<\/p>",$wb="<p>This sample demonstrates how to update an existing portfolio for the authenticated user. It retrieves a list of the user's portfolios, and updates the first portfolio with a title that starts with 'GWT-Finance-Client' with a new title.<\/p>",gxb="<p>This sample demonstrates how to update an existing transaction within a portfolio of the authenticated user. It retrieves and updates the first NASDAQ:GOOG transaction with the 'GWT-Finance-Client' portfolio (Note: The transaction must exist before it can be updated; otherwise an error is generated.)<\/p>",cub="<p>This sample demonstrates how to update the title of an existing event. A full text query is used to locate an event with a title/description containing 'GWT-Calendar-Client', where the first match is updated with the new title. The private/full feed is used for the event update.<\/p>",Xob='<p>This sample demonstrates how to use AuthSub to login, logout and retrieve the authentication status for the current user across the supported GData systems.<\/p>',gBb='<p>This sample displays Sidewiki entries created by the current user.<\/p>',Drb='<p>This sample queries for blog posts that were published within the last month.<\/p>',gvb='<p>This sample retrieves all the contact groups for the authenticated user.<\/p>',Irb='<p>This sample retrieves the comments for a particular blog post.<\/p>',Lrb="<p>This sample returns a list of blog posts for each of the user's blogs. Each post is a link to the actual post.<\/p>",Yrb="<p>This sample returns a specific blog post by querying the entry's URI with getBlogPostFeed().<\/p>",gsb="<p>This sample updates the first blog post it finds that begins with the prefix 'GWT-Blogger-Client'.<\/p>",oyb='<p>This sample uses a snippets query to find an items corresponding to convertibles matching a set of criteria.<\/p>',iyb='<p>This sample uses a snippets query to find items corresponding to digital cameras that match a set of criteria.<\/p>',syb='<p>This sample uses a snippets query to find items corresponding to housing that match a set of criteria.<\/p>',wyb='<p>This sample uses a snippets query to find items corresponding to jobs that match a set of criteria.<\/p>',Ayb='<p>This sample uses a snippets query to find items corresponding to recipes that match a set of criteria.<\/p>',ZAb='<p>This sample uses an entry query to find Sidewiki content by a given author.<\/p>',cBb='<p>This sample uses an en
